import React from 'react';

const Preloader = () => (
  <div id="preloader">
    <div className="pre-container">
      <div className="spinner">
        <div className="double-bounce1" />
        <div className="double-bounce2" />
      </div>
    </div>
  </div>
);

export default Preloader;
